    "import numpy as np\n",
    "import pandas as pd\n",
    "from datetime import datetime\n",
    "import matplotlib.pyplot as plt\n",
    "from mpl_toolkits.mplot3d import Axes3D\n",
    "from scipy.stats import norm\n",
    "from scipy.optimize import minimize_scalar\n",
    "import warnings\n",
    "warnings.filterwarnings('ignore')\n",
    "\n",
    "def black_scholes_call(S, K, T, r, sigma):\n",
    "    \"\"\"Black-Scholes call option price\"\"\"\n",
    "    if T <= 0 or sigma <= 0:\n",
    "        return max(S - K, 0)\n",
    "    \n",
    "    d1 = (np.log(S/K) + (r + 0.5*sigma**2)*T) / (sigma*np.sqrt(T))\n",
    "    d2 = d1 - sigma*np.sqrt(T)\n",
    "    \n",
    "    price = S*norm.cdf(d1) - K*np.exp(-r*T)*norm.cdf(d2)\n",
    "    return max(price, 0)\n",
    "\n",
    "def black_scholes_vega(S, K, T, r, sigma):\n",
    "    \"\"\"Black-Scholes vega (sensitivity to volatility)\"\"\"\n",
    "    if T <= 0:\n",
    "        return 0\n",
    "    \n",
    "    d1 = (np.log(S/K) + (r + 0.5*sigma**2)*T) / (sigma*np.sqrt(T))\n",
    "    vega = S * norm.pdf(d1) * np.sqrt(T)\n",
    "    return vega\n",
    "\n",
    "def implied_volatility_from_price(price, S, K, T, r, initial_guess=0.2):\n",
    "    \"\"\"Calculate implied volatility from option price using Newton-Raphson\"\"\"\n",
    "    if T <= 0 or price <= max(S - K*np.exp(-r*T), 0):\n",
    "        return np.nan\n",
    "    \n",
    "    sigma = initial_guess\n",
    "    \n",
    "    for i in range(100):  # Max iterations\n",
    "        bs_price = black_scholes_call(S, K, T, r, sigma)\n",
    "        vega = black_scholes_vega(S, K, T, r, sigma)\n",
    "        \n",
    "        if abs(vega) < 1e-8:\n",
    "            break\n",
    "            \n",
    "        diff = bs_price - price\n",
    "        if abs(diff) < 1e-6:\n",
    "            break\n",
    "            \n",
    "        sigma = sigma - diff / vega\n",
    "        sigma = max(sigma, 0.001)  # Keep positive\n",
    "        \n",
    "    return sigma if sigma > 0.001 else np.nan\n",
    "\n",
    "def heston_price_analytical(S0, K, v0, kappa, theta, sigma, rho, lambd, tau, r):\n",
    "    \"\"\"Simplified Heston pricing using moment matching\"\"\"\n",
    "    if tau <= 0:\n",
    "        return max(S0 - K, 0)\n",
    "    \n",
    "    # Average variance over the life of the option\n",
    "    if abs(kappa) < 1e-6:\n",
    "        avg_var = v0\n",
    "    else:\n",
    "        avg_var = theta + (v0 - theta) * (1 - np.exp(-kappa * tau)) / (kappa * tau)\n",
    "    \n",
    "    # Effective volatility with skew adjustment\n",
    "    moneyness = np.log(K/S0)\n",
    "    skew_adj = rho * sigma * np.sqrt(avg_var) * moneyness / np.sqrt(tau)\n",
    "    \n",
    "    eff_vol = np.sqrt(avg_var + skew_adj)\n",
    "    eff_vol = max(eff_vol, 0.01)  # Minimum vol\n",
    "    \n",
    "    # Use Black-Scholes with effective volatility\n",
    "    price = black_scholes_call(S0, K, tau, r, eff_vol)\n",
    "    \n",
    "    return max(price, max(S0 - K * np.exp(-r * tau), 0))\n",
    "\n",
    "def create_market_volatility_surface(df, spot_price, risk_free_rate, current_date):\n",
    "    \"\"\"Create volatility surface from market data\"\"\"\n",
    "    \n",
    "    print(\"=\"*60)\n",
    "    print(\"CREATING MARKET VOLATILITY SURFACE\")\n",
    "    print(\"=\"*60)\n",
    "    \n",
    "    # Filter for calls and prepare data\n",
    "    calls = df[df['Type'] == 'call'].copy()\n",
    "    print(f\"Processing {len(calls)} call options\")\n",
    "    \n",
    "    # Calculate maturity\n",
    "    calls['Expiration'] = pd.to_datetime(calls['Expiration'])\n",
    "    calls['maturity'] = (calls['Expiration'] - current_date).dt.days / 365.25\n",
    "    \n",
    "    # Use MarketPrice or calculate midpoint\n",
    "    if 'MarketPrice' in calls.columns:\n",
    "        calls['market_price'] = calls['MarketPrice']\n",
    "    else:\n",
    "        calls['market_price'] = (calls['bid'] + calls['ask']) / 2\n",
    "    \n",
    "    # Filter data\n",
    "    calls = calls[\n",
    "        (calls['maturity'] > 0.005) & \n",
    "        (calls['maturity'] <= 2.0) &\n",
    "        (calls['market_price'] > 0.5) &\n",
    "        (calls['strike'] > spot_price * 0.7) &\n",
    "        (calls['strike'] < spot_price * 1.3)\n",
    "    ].copy()\n",
    "    \n",
    "    print(f\"After filtering: {len(calls)} options\")\n",
    "    print(f\"Maturity range: {calls['maturity'].min():.3f} to {calls['maturity'].max():.3f} years\")\n",
    "    print(f\"Strike range: {calls['strike'].min():.0f} to {calls['strike'].max():.0f}\")\n",
    "    \n",
    "    # Calculate implied volatilities\n",
    "    implied_vols = []\n",
    "    \n",
    "    for idx, row in calls.iterrows():\n",
    "        iv = implied_volatility_from_price(\n",
    "            row['market_price'], \n",
    "            spot_price, \n",
    "            row['strike'], \n",
    "            row['maturity'], \n",
    "            risk_free_rate\n",
    "        )\n",
    "        implied_vols.append(iv)\n",
    "    \n",
    "    calls['implied_vol'] = implied_vols\n",
    "    \n",
    "    # Remove invalid implied volatilities\n",
    "    calls = calls.dropna(subset=['implied_vol'])\n",
    "    calls = calls[(calls['implied_vol'] > 0.05) & (calls['implied_vol'] < 2.0)]\n",
    "    \n",
    "    print(f\"Valid implied volatilities: {len(calls)}\")\n",
    "    print(f\"IV range: {calls['implied_vol'].min():.1%} to {calls['implied_vol'].max():.1%}\")\n",
    "    \n",
    "    # Create moneyness\n",
    "    calls['moneyness'] = calls['strike'] / spot_price\n",
    "    \n",
    "    return calls[['maturity', 'strike', 'moneyness', 'market_price', 'implied_vol']]\n",
    "\n",
    "def create_heston_volatility_surface(heston_params, spot_price, risk_free_rate):\n",
    "    \"\"\"Create volatility surface from Heston model\"\"\"\n",
    "    \n",
    "    print(\"=\"*60)\n",
    "    print(\"CREATING HESTON VOLATILITY SURFACE\")\n",
    "    print(\"=\"*60)\n",
    "    \n",
    "    # Extract parameters\n",
    "    v0 = heston_params['v0']\n",
    "    kappa = heston_params['kappa']\n",
    "    theta = heston_params['theta']\n",
    "    sigma = heston_params['sigma']\n",
    "    rho = heston_params['rho']\n",
    "    lambd = heston_params['lambda']\n",
    "    \n",
    "    print(\"Using Heston parameters:\")\n",
    "    print(f\"  v0: {v0:.6f}\")\n",
    "    print(f\"  kappa: {kappa:.6f}\")\n",
    "    print(f\"  theta: {theta:.6f}\")\n",
    "    print(f\"  sigma: {sigma:.6f}\")\n",
    "    print(f\"  rho: {rho:.6f}\")\n",
    "    print(f\"  lambda: {lambd:.6f}\")\n",
    "    \n",
    "    # Define grid for volatility surface\n",
    "    maturities = np.array([0.02, 0.04, 0.08, 0.16, 0.25, 0.5, 0.75, 1.0, 1.5, 2.0])  # Days to years\n",
    "    moneyness_range = np.array([0.8, 0.85, 0.9, 0.95, 1.0, 1.05, 1.1, 1.15, 1.2])\n",
    "    \n",
    "    # Create meshgrid\n",
    "    T_grid, M_grid = np.meshgrid(maturities, moneyness_range)\n",
    "    strikes = M_grid * spot_price\n",
    "    \n",
    "    # Calculate Heston prices and implied volatilities\n",
    "    heston_prices = np.zeros_like(T_grid)\n",
    "    heston_ivs = np.zeros_like(T_grid)\n",
    "    \n",
    "    print(\"Calculating Heston prices and implied volatilities...\")\n",
    "    \n",
    "    for i in range(T_grid.shape[0]):\n",
    "        for j in range(T_grid.shape[1]):\n",
    "            T = T_grid[i, j]\n",
    "            K = strikes[i, j]\n",
    "            \n",
    "            # Get Heston price\n",
    "            heston_price = heston_price_analytical(\n",
    "                spot_price, K, v0, kappa, theta, sigma, rho, lambd, T, risk_free_rate\n",
    "            )\n",
    "            heston_prices[i, j] = heston_price\n",
    "            \n",
    "            # Calculate implied volatility from Heston price\n",
    "            iv = implied_volatility_from_price(\n",
    "                heston_price, spot_price, K, T, risk_free_rate\n",
    "            )\n",
    "            heston_ivs[i, j] = iv if not np.isnan(iv) else 0\n",
    "    \n",
    "    # Convert to DataFrame for easier handling\n",
    "    results = []\n",
    "    for i in range(T_grid.shape[0]):\n",
    "        for j in range(T_grid.shape[1]):\n",
    "            results.append({\n",
    "                'maturity': T_grid[i, j],\n",
    "                'strike': strikes[i, j],\n",
    "                'moneyness': M_grid[i, j],\n",
    "                'heston_price': heston_prices[i, j],\n",
    "                'heston_iv': heston_ivs[i, j]\n",
    "            })\n",
    "    \n",
    "    heston_surface = pd.DataFrame(results)\n",
    "    heston_surface = heston_surface[heston_surface['heston_iv'] > 0]  # Remove invalid IVs\n",
    "    \n",
    "    print(f\"Generated {len(heston_surface)} Heston surface points\")\n",
