    "def calculate_surface_statistics(market_data, heston_data):\n",
    "    \"\"\"Calculate comparison statistics between surfaces\"\"\"\n",
    "    \n",
    "    print(\"=\"*60)\n",
    "    print(\"SURFACE COMPARISON STATISTICS\")\n",
    "    print(\"=\"*60)\n",
    "    \n",
    "    if len(market_data) == 0 or len(heston_data) == 0:\n",
    "        print(\"Cannot calculate statistics - missing data\")\n",
    "        return\n",
    "    \n",
    "    print(\"Market Surface Statistics:\")\n",
    "    print(f\"  Number of points: {len(market_data)}\")\n",
    "    print(f\"  IV Range: {market_data['implied_vol'].min():.1%} - {market_data['implied_vol'].max():.1%}\")\n",
    "    print(f\"  IV Mean: {market_data['implied_vol'].mean():.1%}\")\n",
    "    print(f\"  IV Std: {market_data['implied_vol'].std():.1%}\")\n",
    "    \n",
    "    print(\"\\nHeston Surface Statistics:\")\n",
    "    print(f\"  Number of points: {len(heston_data)}\")\n",
    "    print(f\"  IV Range: {heston_data['heston_iv'].min():.1%} - {heston_data['heston_iv'].max():.1%}\")\n",
    "    print(f\"  IV Mean: {heston_data['heston_iv'].mean():.1%}\")\n",
    "    print(f\"  IV Std: {heston_data['heston_iv'].std():.1%}\")\n",
    "    \n",
    "    # Find overlapping points for direct comparison\n",
    "    overlapping_points = []\n",
    "    \n",
    "    for _, market_row in market_data.iterrows():\n",
    "        # Find closest Heston point\n",
    "        distances = np.sqrt(\n",
    "            (heston_data['maturity'] - market_row['maturity'])**2 + \n",
    "            (heston_data['moneyness'] - market_row['moneyness'])**2\n",
    "        )\n",
    "        \n",
    "        if distances.min() < 0.1:  # Close enough\n",
    "            closest_idx = distances.idxmin()\n",
    "            heston_row = heston_data.loc[closest_idx]\n",
    "            \n",
    "            overlapping_points.append({\n",
    "                'maturity': market_row['maturity'],\n",
    "                'moneyness': market_row['moneyness'],\n",
    "                'market_iv': market_row['implied_vol'],\n",
    "                'heston_iv': heston_row['heston_iv'],\n",
    "                'difference': market_row['implied_vol'] - heston_row['heston_iv']\n",
    "            })\n",
    "    \n",
    "    if overlapping_points:\n",
    "        overlap_df = pd.DataFrame(overlapping_points)\n",
    "        \n",
    "        print(f\"\\nOverlapping Points Analysis ({len(overlap_df)} points):\")\n",
    "        print(f\"  Mean Absolute Difference: {abs(overlap_df['difference']).mean():.1%}\")\n",
    "        print(f\"  RMS Difference: {np.sqrt((overlap_df['difference']**2).mean()):.1%}\")\n",
    "        print(f\"  Max Difference: {overlap_df['difference'].max():.1%}\")\n",
    "        print(f\"  Min Difference: {overlap_df['difference'].min():.1%}\")\n",
    "        \n",
    "        return overlap_df\n",
    "    else:\n",
    "        print(\"\\nNo overlapping points found for direct comparison\")\n",
    "        return None\n",
    "\n",
