    "def compare_heston_prices():\n",
    "    # Parameters\n",
    "    S0 = 100       # Spot price\n",
    "    r = 0.05       # Risk-free rate\n",
    "    v0 = 0.04      # Initial variance (0.04 = 20% vol)\n",
    "    kappa = 1.0    # Mean reversion speed\n",
    "    theta = 0.04   # Long-term variance\n",
    "    sigma = 0.2    # Vol of vol\n",
    "    rho = -0.7     # Correlation\n",
    "    lambd = 0.0    # Risk premium (not used in simplified version)\n",
    "    \n",
    "    # Range of strikes and maturities to test\n",
    "    strikes = np.linspace(80, 120, 9)\n",
    "    maturities = np.linspace(0.1, 2.0, 5)\n",
    "    \n",
    "    results = []\n",
    "    \n",
    "    for T in maturities:\n",
    "        for K in strikes:\n",
    "            try:\n",
    "                # Full Heston model\n",
    "                price_full = heston_call_price(S0, K, T, r, v0, kappa, theta, sigma, rho)\n",
    "                \n",
    "                # Simplified analytical approximation\n",
    "                price_approx = heston_price_analytical(S0, K, v0, kappa, theta, sigma, rho, lambd, T, r)\n",
    "                \n",
    "                # Difference and percentage difference\n",
    "                diff = price_full - price_approx\n",
    "                pct_diff = (diff / price_full) * 100 if price_full > 0 else 0\n",
    "                \n",
    "                results.append({\n",
    "                    'T': T,\n",
    "                    'K': K,\n",
    "                    'Full_Heston': price_full,\n",
    "                    'Approximation': price_approx,\n",
    "                    'Difference': diff,\n",
    "                    'Pct_Difference': pct_diff\n",
    "                })\n",
    "                \n",
    "            except Exception as e:\n",
    "                print(f\"Error calculating for K={K}, T={T}: {str(e)}\")\n",
    "                continue\n",
    "    \n",
    "    # Print results\n",
    "    print(f\"{'T':>5} {'K':>7} {'Full Heston':>12} {'Approx':>12} {'Diff':>12} {'% Diff':>12}\")\n",
    "    print(\"-\" * 65)\n",
    "    for r in results:\n",
    "        print(f\"{r['T']:5.2f} {r['K']:7.2f} {r['Full_Heston']:12.4f} {r['Approximation']:12.4f} \"\n",
    "              f\"{r['Difference']:12.4f} {r['Pct_Difference']:12.2f}%\")\n",
    "    \n",
    "    # Plot results\n",
    "    plt.figure(figsize=(12, 8))\n",
    "    for T in maturities:\n",
    "        subset = [r for r in results if r['T'] == T]\n",
    "        strikes = [r['K'] for r in subset]\n",
    "        full_prices = [r['Full_Heston'] for r in subset]\n",
    "        approx_prices = [r['Approximation'] for r in subset]\n",
    "        \n",
    "        plt.plot(strikes, full_prices, '-o', label=f'Full Heston (T={T:.1f})')\n",
    "        plt.plot(strikes, approx_prices, '--s', label=f'Approximation (T={T:.1f})')\n",
    "    \n",
    "    plt.title('Comparison of Heston Model vs Analytical Approximation')\n",
    "    plt.xlabel('Strike Price')\n",
    "    plt.ylabel('Option Price')\n",
    "    plt.legend()\n",
